@Component({
	selector: 'app-home',
	templateUrl: './home.component.html',
})
export class HomeComponent {
}
<h1>Book Library</h1>
<p>Welcome to Book Library Management. Where you can:</p>
<ul>
	<li>Add Book</li>
	<li>Update Book</li>
	<li>Delete Book</li>
	<li>View Details of a Book</li>
</ul>
